import React, { Component } from 'react';

class Team extends Component {
  render() {
    return (
      <div class="col-lg-4 col-sm-6">
        <div class="team-card-style-1 mx-auto">
          <div class="team-card-inner">
            <div class="team-thumb"><img className="img-thumbnail w-75" src={this.props.foto} style={{border:"0", borderRadius:"0", backgroundColor:"transparent"}} />
            </div>
            <div class="team-social-bar text-center"><a class="social-btn sb-style-4 sb-github" style={{color:"#fff"}} href="#"><i class="fab fa-github-square"></i></a><a href="#"style={{color:"#fff", fontSize}} ><i class="fab fa-linkedin"></i></a></div>
          </div><span class="team-position">{this.props.funcao}</span>
          <h4 class="team-name">{this.props.nome}</h4>
        </div>
      </div>
    )
  }
}

export default Team;
